import React from "react";
import { useFrame } from 'react-three-fiber';
import { useRef } from "react";

function Logo() {
  const meshRef = useRef();

  useFrame(() => {
    meshRef.current.rotation.x += 0.01;
    meshRef.current.rotation.y += 0.01;
  });

  return (
    <mesh ref={meshRef}>
      {'./img/riozacki_logo.png'}
    </mesh>
  );
}

export default Logo;
